import React, { useState, useEffect } from 'react';
import BookItem from './BookItem';

const BookList = () => {
  const [books, setBooks] = useState([]);

  useEffect(() => {
    const fetchBooks = async () => {
      try {
        const response = await fetch('https://books.google.co.in/books?uid=103234538657727512031&as_coll');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.text(); // Use response.text() to handle HTML response
        // Handle the HTML data as needed
        console.log(data); // For example, log the HTML data
      } catch (error) {
        console.error('Error fetching books:', error);
      }
    };

    fetchBooks();
  }, []);

  return (
    <div className="book-list">
      {books.map(book => (
        <BookItem key={book.id} book={book} />
      ))}
    </div>
  );
}

export default BookList;
